const  App = ()=>{
    const [name, setName] = useState();
    return(
    <>
        <div>
            <h1>Hello {name}</h1>
            <input placeholder='Please Enter Your Name' value={name}/>&nbsp;&nbsp;
            <button>Click Here</button>
        </div>
    </>
    )
}

export default App;
